const StockPreview = ({ stock }) => {

    const {id, imgURL, name, type, quantity, supplier, note} = stock;

    return (
        <div>
            {stock ? <div>
                        <img src={stock.imgURL} alt={stock.name} width={'50px'} />
                        <p>{stock.name}</p>
                        <p>{stock.type}</p>
                        <p>{stock.quantity}</p>
                        <p>{stock.supplier}</p>
                        <p>{stock.note}</p>
                     </div> : null}
        </div>
    );
}

export default StockPreview;
